import React from "react";

export default function Input(props) {
    const { handleChange, handleOnClick } = props;
    return (
        <>
            <input
                type="text"
                id="name"
                name="name"
                id="input-text"
                placeholder="Search"
                onChange={handleChange}
            />

            <button onClick={handleOnClick}>
                <i className="fa fa-search" />
            </button>
        </>
    );
}
